import firebase from "firebase";

const app = firebase.initializeApp({
  apiKey: process.env.AIzaSyDAEhUBGlpzdnjmQ9dEWNdW_WzAhxBQ11g,
  authDomain: process.env.localify-app.firebaseapp.com,
  databaseURL: process.env.localify-app.firebaseio.com,
  projectId: process.env.localify-app,
  storageBucket: process.env.localify-app.appspot.com,
  messagingSenderId: process.env.REACT_APP_FIREBASE_SENDER_ID
});

export default app;
